import React, { Component } from 'react';
import './ButtonCounter.css';

class ButtonCounter extends Component {

    render() {
        return (
            <button id="count-btn" onClick={ this.props.click }>
            { this.props.value }
            </button>
        );
    }

}

export default ButtonCounter;
